import React from "react";

import { Link } from 'react-router-dom';

function ButtonProfile(){
    return(
        <div class="Buttonfix">
            <Link to="/editp"><input type="button" value="Profile"class="w3-center w3-hide-small"></input></Link>
        </div>
    );
}

export default ButtonProfile;
